'''Duke Horacio''' is the duke of [[Lumbridge]] and the surrounding area. He lives on the {{FloorNumber|uk=1}} of the [[Lumbridge Castle]] in a room with a quest marker in it. He also hands out [[anti-dragon shield]]s to players during the [[Dragon Slayer I]] [[quest]]. More shields can be obtained via the [[drop trick]].

