==Trivia==
*In ''[[RuneScape Classic]]'', he was simply known as Duke of Lumbridge.
*Since [[Lumbridge]] is based on the real life city of {{Wp|Cambridge}}, England, the real life analog of Duke Horacio would be the {{Wp|Duke of Cambridge}}. This title was extinct when ''RuneScape'' was released, but has since been brought back.

